var fs = require('fs');
var data = 'data:image/png;base64,'

var path = 'zzpic/'+ Date.now() +'.png';//app.js--
var base64 = data.replace(/^data:image\/\w+;base64,/, "");//base64data:image/png;base64
var dataBuffer = new Buffer(base64, 'base64'); //base64buffer
console.log('dataBufferBuffer'+Buffer.isBuffer(dataBuffer));
fs.writeFile(path,dataBuffer,function(err){//fs
    if(err){
        console.log(err);
    }else{
        console.log('');
    }
})